import React, { Component } from "react";

class Test extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
      isLoaded: false,
    }
  }

  componentDidMount() {
    fetch('http://45.77.232.166:8080/get-pcos')
      .then(res => res.json())
      .then(json => {
        this.setState({
          isLoaded:true,
          items: json,
        })
      });
  }

  
  
  render() {

    var{ isLoaded, items} = this.state;
    if(!isLoaded) {
      return <div>Loading...</div>
    }
    else {
      return(
        <div className ="Test">
            Data loaded
            <ul>
                <li key={item.id}>
                  Name : {item.name} | Id : {item.id}
                </li>
            </ul>
        </div>
      );
    }
    
  }

};

export default Test;
